// src/pages/GoodsDashboard.js
import React from 'react';

const GoodsDashboard = () => {
  return (
    <div>
      <h1>Goods Dashboard</h1>
      <p>This is the Goods Dashboard page.</p>
    </div>
  );
};

export default GoodsDashboard;
